	var Agent = function(){

		// the direction in which the agent is moving
		this.d = "left"; // initialise this as left, I think

		this.agent_array = this.create_snake(); // this will call another prototype function to init

		// We're adding in an offset to further differentiate the agents
		this.x_subGrid_offset = Math.round(Math.random() * (N - 1));
		this.y_subGrid_offset = Math.round(Math.random() * (N - 1));

		// http://martin.ankerl.com/2009/12/09/how-to-create-random-colors-programmatically/
		this.colour;

		// actions the agent can take
    this.actions = [];
    this.actions.push("left");
    this.actions.push("up");
    this.actions.push("right");
    this.actions.push("down");

    // neural network stuff
    var num_inputs = N * N; // H X W number of cells. We're sticking with 5 X 5 since that's what it was trained on
		var num_actions = 4; // 4 possible directions the agent can turn
		var temporal_window = 1; // amount of temporal memory
		var network_size = num_inputs*temporal_window + num_actions*temporal_window + num_inputs;

		// the value function network computes a value of taking any of the possible actions
		// given an input state. Here we specify one explicitly the hard way
		// but user could also equivalently instead use opt.hidden_layer_sizes = [20,20]
		// to just insert simple relu hidden layers.
		var layer_defs = [];
		layer_defs.push({type:'input', out_sx:1, out_sy:1, out_depth:network_size});
		layer_defs.push({type:'fc', num_neurons: 50, activation:'relu'});
		layer_defs.push({type:'fc', num_neurons: 50, activation:'relu'});
		layer_defs.push({type:'regression', num_neurons:num_actions});

		// We don't care too much about the options for learning, except 
		// epsilon value at test time.

		// options for the Temporal Difference learner that trains the above net
		// by backpropping the temporal difference learning rule.
		var tdtrainer_options = {learning_rate:0.001, momentum:0.0, batch_size:64, l2_decay:0.01};

		var opt = {};
		opt.temporal_window = temporal_window;
		opt.experience_size = 30000;
		opt.start_learn_threshold = 1000;
		opt.gamma = 0.7;
		// changing the burn through rate from 200,000 to 3,000 since we've already built up to a decent level
		opt.learning_steps_total = 100000;
		opt.learning_steps_burnin = 3000;
		// changing epsilon min to 0.01 from 0.05 since mistakes are so costly
		// chaning it back again since we have a doube check if a mistake is made
		opt.epsilon_min = 0.01;
		opt.epsilon_test_time = 0.01;
		opt.layer_defs = layer_defs;
		opt.tdtrainer_options = tdtrainer_options;

		var brain = new deepqlearn.Brain(num_inputs, num_actions, opt);

		// load pre-trained network from JSON and turn off learning
		var j = JSON.parse(initialJSON);
		brain.value_net.fromJSON(j);
		brain.learning = false;

		this.brain = brain;



	}
	Agent.prototype = {
		create_snake: function(){
			// we're starting with length two to get it working
			var length = Math.round(Math.random() * 6) + 3;
			// We're starting it in the middle but I'd prefer a random location
	    var x_offset = Math.round(Math.random()*(w-cw)/cw);
	    var y_offset = Math.round(Math.random()*(h-cw)/cw);

	    var snake_array = [];
	    // this will be reversed for the actual thing once it's working
      for(var i = x_offset; i < x_offset + length; i++)
      {
        //This will create a horizontal snake starting from the top left
        snake_array.push({x: i % (w/cw), y:y_offset});
        // test_array[i,0] = 2;
      }

      return snake_array;
		},

		update_board: function() {

			var current_subgrid = this.get_current_subgrid();
			var input_array = [];

			for(var i = 0; i < current_subgrid.length; i++)
			{
				input_array = input_array.concat(current_subgrid[i]);
			}

			this.forward(input_array);

			// the x and y locations of the snake's head
			var nx = this.agent_array[0].x;
			var ny = this.agent_array[0].y;

				// I'm not a fan of single letter variable names but
				// this whole section becomes unreadable without them
			       if(this.d == "right") nx = (nx + 1 == w/cw ? 0: nx + 1);
		    else if(this.d == "left") nx = (nx - 1 == -1 ? w/cw-1: nx - 1);
		    else if(this.d == "up") ny = (ny - 1 == -1 ? h/cw-1: ny - 1);
		    else if(this.d == "down") ny = (ny + 1 == h/cw ? 0: ny + 1);

		    var tail = this.agent_array.pop();
		    tail.x = nx; tail.y = ny;
		    this.agent_array.unshift(tail); // unshift makes the tail the first element in the array

		    for(var i = 0; i < this.agent_array.length; i++)
		    {
		    	var cell = this.agent_array[i];
		    	// paints 10px wide cells
		    	cell_colour = 'rgb(255, 0, 255)';
		    	this.paint_cell(cell.x, cell.y, cell_colour);
		    }

		},

		get_current_subgrid: function(){
			// We're using a 5 X 5 subgrid to match with what it's been trained on
			var test_array = this.zeros([N, N]);

			// we put down food first so that it will be overwritten if
			// the head is on top of it


			// we only give the network the head of the snake
			var head = this.agent_array[0];
			// I don't remember why the x and y things have to be reversed
			// we use mods to translate its location onto the subgrid
			// and an offset so they're more uniformly distributed
			test_array[(head.y + this.y_subGrid_offset) % N][(head.x + this.x_subGrid_offset) % N] = 2;

			return test_array;
		},

		zeros: function(dimensions){
	      var array = [];

	      for (var i = 0; i < dimensions[0]; ++i) 
	      {
	          array.push(dimensions.length == 1 ? 0 : this.zeros(dimensions.slice(1)));
	      }

	      return array;
		},

		forward: function(input_array){
			// this is where the agents get it's next move from

	      var actionix = this.brain.forward(input_array);
	      var action = this.actions[actionix];

	      if(action == "left" && this.d != "right") this.d = "left";
	      else if(action == "up" && this.d != "down") this.d = "up";
	      else if(action == "right" && this.d != "left") this.d = "right";
	      else if(action == "down" && this.d != "up") this.d = "down";
		},

		paint_cell: function(x, y, colour){
	      ctx.fillStyle = colour;
	      ctx.fillRect(x*cw, y*cw, cw, cw);
	      // this creates a slight gap between cells, we might remove it?
	      ctx.strokeStyle = "white";
	      ctx.strokeRect(x*cw, y*cw, cw, cw);
		}
	}

	function start()
	{
		agents = [];

		for(var i = 0; i < 30; i++)
		{
			agents.push(new Agent);
		}

    if(typeof game_loop != "undefined") clearInterval(game_loop);
    game_loop = setInterval(update, 80);
	}
	start();

